command(
  {
    pattern: "amute ?(.*)",
    fromMe: isPrivate,  
    desc: "auto mutes group",
    type: "group",
  },
  async (message, match, m, client) => {
    try{
    if (!message.isGroup)
      return await message.reply("_This command is for groups_");
    if (!match) return message.reply("_Enter time to mute_\nEg : amute 20:10");
   let isadmin = await isAdmin(message.jid, message.key.participant, message.client);
    if (!isadmin) return await message.reply("_You're not admin_");
    let ismeadmin = await isAdmin(message.jid, message.user, message.client);
    if (!ismeadmin) return await message.reply("_I'm not admin_");
    message.reply(`_Group will mute at ${match}_`);
    await saveSchedule(message.jid, match, async () => {
      await message.reply("_Muting_");
      return await client.groupSettingUpdate(message.jid, "announcement");
    });
    return cron(match, async () => {
      await message.reply("_Muting_");
      return await client.groupSettingUpdate(message.jid, "announcement");
    });
  } catch (error) {
    console.error("[Error]:", error);
  }

  }
);
command(
  {
    pattern: "aunmute ?(.*)",
    fromMe: isPrivate,  
    desc: "auto unmutes group",
    type: "group",
  },
  async (message, match, m, client) => {
    try{
    if (!message.isGroup)
      return await message.reply("_This command is for groups_");
    if (!match)
      return message.reply("_Enter time to unmute_\nEg : aunmute 20:10");

    let isadmin = await isAdmin(message.jid, message.key.participant, message.client);
    if (!isadmin) return await message.reply("_You're not admin_");
    let ismeadmin = await isAdmin(message.jid, message.user, message.client);
    if (!ismeadmin) return await message.reply("_I'm not admin_");
    message.reply(`_Group will unmute at ${match}_`);
    await saveSchedule(message.jid, match, async () => {
      await message.reply("_Auto Unmuting_");
      return await client.groupSettingUpdate(message.jid, "not_announcement");
    });
    return cron(match, async () => {
      await message.reply("_Auto Unmuting_");
      return await client.groupSettingUpdate(message.jid, "not_announcement");
    });
  } catch (error) {
    console.error("[Error]:", error);
  }

  }
);
command(
  {
    pattern: "gjid",
    fromMe: isPrivate,  
    desc: "gets jid of all group members",
    type: "group",
  },
  async (message, match, m, client) => {
    try{
    if (!message.isGroup)
      return await message.reply("_This command is for groups_");
    let { participants } = await client.groupMetadata(message.jid);
    let participant = participants.map((u) => u.id);
    let str = " *Group Jids* \n";
    participant.forEach((result) => {
      str += ` *${result}*\n`;
    });
    str += ``;
    message.reply(str);
  } catch (error) {
    console.error("[Error]:", error);
  }

  }
);
/**
 * antilink
 */
command(
  {
    on: "text",
    fromMe: false,  
  },
  async (message, match) => {
    try{
    if (!message.isGroup) return;
    if (config.ANTILINK)
      if (isUrl(match)) {
        await message.reply("_Link detected_");
        let botadmin = await isAdmin(message.jid, message.user, message.client);
        let senderadmin = await isAdmin(
          message.jid,
          message.participant,
          message.client
        );
        if (botadmin) {
          if (!senderadmin) {
            await message.reply(
              `_Commencing Specified Action :${config.ANTILINK_ACTION}_`
            );
            return await message[config.ANTILINK_ACTION]([message.participant]);
          }
        } else {
          return await message.reply("_I'am not admin_");
        }
      }
    } catch (error) {
      console.error("[Error]:", error);
    }

  }
);
command(
  {
    pattern: "revoke",
    fromMe: isPrivate,  
    desc: "nute group",
    type: "group",
  },
  async (message, match, m, client) => {
    try{
    if (!message.isGroup)
      return await message.reply("_This command is for groups_");
    let isadmin = await isAdmin(message.jid, message.key.participant, message.client);
    if (!isadmin) return
    return await message.revokeLink(message.jid);
  } catch (error) {
    console.error("[Error]:", error);
  }

  }
);

command(
  {
    pattern: "fullgcpp",
    fromMe: isPrivate,  
    desc: "Set Full profilr picture for Group",
    type: "group",
  },
  async (message, match, m) => {
    try{
      if (!message.isGroup)
        return await message.reply("_This command is for groups_");
    if (!message.reply_message.image)
      return await message.reply("_Reply to a photo_");
    let isadmin = await isAdmin(message.jid, message.key.participant, message.client);
    if (!isadmin) return
    let buff = await m.quoted.download();
    await message.SetFullPP(message.jid , buff, message);
    return await message.reply("_Profile Picture Updated_");
  } catch (error) {
    console.error("[Error]:", error);
  }
  }
);

command(
  {
    pattern: "del",
    fromMe: isPrivate,  
    desc: "Delete messages",
    type: "group",
  },
  async (message, match) => {
    try{
      if (!message.isGroup) return;
      if (!message.reply_message) return;
    message.reply_message.jid;
    let key = await message.reply_message.key
    let isadmin = await isAdmin(message.jid, message.key.participant, message.client);
    if (!isadmin) return await message.reply("_You're not admin_");
    let ismeadmin = await isAdmin(message.jid, message.user, message.client);
    if (!ismeadmin) return await message.reply("_I'm not admin_");
    return await message.client.sendMessage(message.jid, { delete: key})
  } catch (error) {
    console.error("[Error]:", error);
  }

  }
);


